import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import React, { useState } from 'react';
import ToggleButton from 'react-bootstrap/ToggleButton';
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup';
import { Link, Routes, Route, useNavigate } from 'react-router-dom';

const QuizTP = () => {

    const[text, setText] = useState("")


    return ( 
        <div className="q-second-page">
        <Container display="flex">
            <div className="prog-bar">
                {/*The progress bar goes here*/}
            </div>

            <div className="form-title">
                <h4 className="fw-bold">Final Details</h4>
                <p>You're almost done but safety first</p>

                <div className="row mt-5">
                        <div className="col-lg-6">
                            <Form.Group className="mb-3" controlId="form.newPass">
                                <Form.Label>Set Password:</Form.Label>
                                <Form.Control type="password" placeholder="" />
                                <small id="nameHelp" className="text-danger form-text"></small>
                            </Form.Group>
                        </div>
                        <div className="col-lg-6">
                            <Form.Group className="mb-3" controlId="form.Name">
                                <Form.Label>Confirm Password:</Form.Label>
                                <Form.Control type="password" placeholder="" />
                                <small id="lnameHelp" className="text-danger form-text"></small>
                            </Form.Group>
                        </div>
                </div>
            </div>


            {/*Back/Next btns*/}
            <div className="row align-items-center justify-content-between">
                <div className="col-lg-6">
                    <Link to="/questions" className="btn btn-secondary text-center fw-bold"> Nope </Link>
                </div>
                <div className="col-lg-6">
                    <Link to="/confirm" className="btn btn-primary text-center fw-bold"> Yeah </Link>
                </div>
            </div>
        </Container>
        </div>

     );
}

export default QuizTP;
